function Home() {
    return (
      <div>
        <h2>Página Inicial</h2>
        <p>Este é um projeto de um blog feito em REACT e NODE.</p>
        <p>Para iniciar o servidor node usar o comando -- node server.js --</p>
        <p>Para iniciar o react usar o comando -- npm start --</p>
      </div>
    );
  }

  export default Home;
